import React from "react";

export function IndexPage() {
  return (
    <React.Fragment>
      <h1 className="text-center">Fag el-Gamous</h1>
      <br />
      <br />
      <div className="text-center">
        <img
          src="../front.jpg"
          alt="Evacuation Site"
          style={{ width: "500px" }}
        />
      </div>
    </React.Fragment>
  );
}
